text:
Verdades que a torcida do Grêmio nunca vai aceitar:
- Mancini é bom técnico;
- Se tivessem marcado 30% dos pênaltis que não deram pra nós na reta final, não cairíamos;
- Grêmio com ele jogou MUITO MAIS do que com o Felipão (saudoso) e com o Thiago Nunes;
- Só foi demitido porque não tem o temperamento do Simeone e não ficava berrando o jogo todo;
- Muita gente vai secar ele até a morte pra torcer pra tese;
- Não precisa defenestrar o trabalho dele pra enaltecer o do Roger, ambos são bons treinadores.

Que comece a 3ª Guerra Mundial.
